import React from 'react';

import styles from "./TextSection.module.css";

function TextSection(props) {
    return (
        <article className = {styles.article}>
            <h1>Poems and Stories</h1>
            <p>Upload your writing</p>
        </article>
    );
}

export default TextSection;
